import { withAuth } from "../../hoc/withAuth";
import * as actions from "../../store/actions";

const JobsContainer = () => {
  return (
    <section>
      <h1>jobs</h1>
    </section>
  );
};

JobsContainer.getInitialProps = (ctx) => {
  ctx.store.dispatch(actions.getUser());
};

export default withAuth(JobsContainer);
